10078.objetoCompra:
Reparo do Separador de Óleo Lubrificante do Compressor do Sistema de Ar-condicionado Central.

O serviço deverá incluir:
-  Substituição do Separador de Óleo Lubrificante (Fabricante: Henry Technologies;  Modelo: S-5694-CE);
-   Substituição de tubos de comunicação do Óleo Lubrificante;
- Substituição do Óleo Lubrificante do Sistema (OL 175 PZ);
- Recompletamento do Fluido Refrigerante (Gás R-404A); e
- Acompanhamento do funcionamento do Sistema, fornecendo garantia de 6 meses do funcionamento.

10401.informacaoComplementar:
Contratação de prestação de serviço de manutenção corretiva, de suporte técnico, para atender às necessidades da Policlínica Naval de Campo Grande, sem vínculo trabalhista entre a prestadora do serviço e esta Policlínica, que se dará da seguinte forma:
Serviço manutenção corretiva constando de limpeza óptica, ajuste de posicionamento da lâmpada e ajuste mecânico no equipamento lâmpada de fenda vision;
Serviço manutenção corretiva constando de limpeza óptica, lubrificação e ajuste mecânico no equipamento tonômetro de aplanação;
Serviço manutenção corretiva constando de limpeza óptica, ajuste de posicionamento da lâmpada e ajuste mecânico no equipamento lâmpada de refrator vision; e
Serviço manutenção corretiva constando de ajuste de posicionamento do eixo do suporte do prisma, lubrificação e aferição do equipamento GRK 7000 Gilras.

10459.objetoCompra:
Serviço de Reparo da Bomba Submersível FLYGT 2630.181. 
O serviço engloba:
- Rebobinamento do Motor da Bomba;
- Troca do Rolamento Superior;
- Troca do Rolamento Inferior;
- Troca do Jogo de Anéis – O;
- Troca do Conjunto de Vedação;
- Balanceamento do Conjunto Rotativo;
- Aquisição de 01 UN  Cabo Elétrico para sobressalente;
- Limpeza com Etileneglicol; e
- Teste com equipamento.

Ressalta-se que o equipamento deve ser retirado e entregue no Navio de Apoio Oceânico Mearim.

